import React from 'react'
import { Card, CardContent, Typography } from '@mui/material';

function TrainerCard({first_name, email, specialization, bio}) {
    return (
        <div className="trainer-card">
          <h3>{first_name}</h3>
          <p>Email: {email}</p>
          <p>Bio: {bio}</p>
          <p>Specialization: {specialization}</p>
        </div>
      );
    }
